<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <script>
        


        var Op = Object.prototype;
        var hasOwn = Op.hasOwnProperty; // 是否位自己的属性
        var defineProperty = Object.defineProperty || function (obj, key, desc) { obj[key] = desc.value; };
        var undefined; // More compressible than void 0.
        var $Symbol = typeof Symbol === "function" ? Symbol : {};
        var iteratorSymbol = $Symbol.iterator || "@@iterator"; // 这里是一个symbol类型的值
        var asyncIteratorSymbol = $Symbol.asyncIterator || "@@asyncIterator";  // 异步迭代器
        var toStringTagSymbol = $Symbol.toStringTag || "@@toStringTag"; // toStringTag



        function values(iterable) {
            if (iterable) {
                var iteratorMethod = iterable[iteratorSymbol];
                if (iteratorMethod) {
                    return iteratorMethod.call(iterable);
                }
            }
        }

        var getProto = Object.getPrototypeOf;
        // 获取原生的迭代器
        var NativeIteratorPrototype = getProto && getProto(getProto(values([])));
        
        console.log(getProto(values([])), NativeIteratorPrototype)
    </script>
</body>
</html>
